DROP TABLE alumno;

CREATE TABLE `alumno` (
  `idAlumno` int(11) NOT NULL DEFAULT '0',
  `nombre` varchar(45) DEFAULT NULL,
  `apellido` varchar(45) DEFAULT NULL,
  `identidadAl` bigint(16) DEFAULT NULL,
  `estado_idEstado` int(11) NOT NULL,
  `foto` varchar(45) DEFAULT 'noFoto',
  `nacimiento` date DEFAULT NULL,
  `genero` varchar(45) DEFAULT NULL,
  `rh` varchar(45) DEFAULT NULL,
  `dir` varchar(45) DEFAULT NULL,
  `celular` decimal(10,0) DEFAULT '0',
  `condicion` varchar(45) NOT NULL DEFAULT 'noCondicion',
  `grado_idGrado` int(11) NOT NULL,
  `matricula_idMatricula` int(11) NOT NULL,
  `cedulaAcu` bigint(20) NOT NULL DEFAULT '0',
  `nombreAcu` varchar(100) NOT NULL DEFAULT '--',
  `dirAcu` varchar(150) NOT NULL DEFAULT '--',
  `celAcu` bigint(16) NOT NULL DEFAULT '0',
  `sede` varchar(40) NOT NULL,
  `idMadreA` int(20) NOT NULL DEFAULT '0',
  `idPadreA` int(15) NOT NULL DEFAULT '0',
  `madreNombreA` varchar(100) NOT NULL DEFAULT '--',
  `padreNombreA` varchar(100) NOT NULL DEFAULT '--',
  `madreApellidoA` varchar(100) NOT NULL DEFAULT '--',
  `padreApellidoA` varchar(100) NOT NULL DEFAULT '--',
  `celMadreA` int(20) NOT NULL DEFAULT '0',
  `celPadreA` int(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`idAlumno`,`grado_idGrado`,`matricula_idMatricula`),
  KEY `fk_alumno_estado1_idx` (`estado_idEstado`),
  KEY `fk_alumno_grado1_idx` (`grado_idGrado`),
  KEY `fk_alumno_matricula1_idx` (`matricula_idMatricula`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




DROP TABLE anio;

CREATE TABLE `anio` (
  `idAnio` int(11) NOT NULL AUTO_INCREMENT,
  `numeroAnio` int(11) DEFAULT NULL,
  `anioRectora` varchar(80) DEFAULT NULL,
  PRIMARY KEY (`idAnio`),
  UNIQUE KEY `idAnio_UNIQUE` (`idAnio`)
) ENGINE=InnoDB AUTO_INCREMENT=2020 DEFAULT CHARSET=utf8;




DROP TABLE estado;

CREATE TABLE `estado` (
  `idEstado` int(11) NOT NULL,
