  UNIQUE KEY `idGrado_UNIQUE` (`idGrado`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;




DROP TABLE logros;

CREATE TABLE `logros` (
